import React from 'react';
import ProfileIcon from '../profile/ProfileIcon';

const LoginNavigation = ({ name, onRouteChange, isSignedIn, toggleModal }) => {
		if (isSignedIn === "true"){
		return ( 
		<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <ProfileIcon name={name} onRouteChange={onRouteChange} toggleModal={toggleModal} />
		 </nav>
		 );
		} else if (isSignedIn === "false") {
		return (
			<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <p onClick={() =>  onRouteChange('signin')} className='f4 b link dib black  pa3 pointer' > Sign in </p>
		  <p onClick={() =>  onRouteChange('register')} className='f4  b link dib black  pa3 pointer' > Register </p>
		 </nav>
        );
	} 
}
export default LoginNavigation;
